import React from "react";
import {useParams} from "react-router-dom"

// You could use destructuring directly in the function signature for cleaner code
const Detail = ({ id, title, overview }) => {
  return (
    <div>
      <h1>Detail</h1>
      {/* Use backticks for multi-line strings and to easily insert variables */}
      <p>ID: {id}</p>
      <p>Title: {title}</p>
      <p>Overview: {overview}</p>
    </div>
  );
};

export default Detail
